import facebook from "../../assets/facebook.png";

const Footer = () => {
  return (
    <footer id="footer">
      <div className="links">
        <img src={telegram} alt="telegram" />
        <img src={vk} alt="telegram" />
        <img src={facebook} alt="telegram" />
      </div>
      <h4>Developed By NVG team</h4>
      <h5>Â© Copyright 2015-2020</h5>
    </footer>
  );
};

export default Footer;
